import logo from './logo.svg';
import './App.css';
import Bienvenido from './components/Welcome';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

//<Bienvenido message="Hola welcome props" nombre="Diuks"/>
